import React from "react";
import Filters from '../Filters'

export default function Cards (props){
    return (
        <div>
            <Filters/>
            <div className="listado">
                <ul>
                    {props.perritos.map(perro => {
                        <li>perro.name</li>
                    })}
                </ul>
            </div>
        </div>
    )
}
